import React from "react";

import Card from "../UI/Card";

import styles from "./Piece.module.css";

function Piece(props) {
  return (
    <Card className={styles["piece"]}>
      <div>
        <h1>{props.title} </h1>
        <h1>By {props.author}</h1>
      </div>
      {/* {props.id} */}
      <h2>{props.type}</h2>
    </Card>
  );
}

export default Piece;
